import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import { StyledLink } from 'your-styled'; // Certifique-se de importar o componente StyledLink corretamente

function SeuComponente() {
    return (
        <div>
            <StyledLink to="/perfil" style={{ display: 'flex', alignItems: 'center' }}>
                <FontAwesomeIcon icon={faUser} size="lg" />
            </StyledLink>
            <StyledLink to="/" style={{ display: 'flex', alignItems: 'center' }}>
                <FontAwesomeIcon icon={faSignOutAlt} size="lg" />
            </StyledLink>
        </div>
    );
}

export default SeuComponente;
